import { BrowserRouter, Route } from "react-router-dom";
import Authorization from "./components/Autorization/Authorization";

function App() {
  return (
    <div className="App">
      <Router>
        <Route path="/authorization"><Authorization /></Route>
      </Router>
    </div>
  );
}

export default App;
